  render() {

    return (

      <div>
        <Consumer>
          {(value) =>
            <div>
              <div>子组件的传值：{value}</div>
              <B />
              <C />
            </div>
          }

        </Consumer>
      </div>

    )
  }
}

export default withRouter(Show);
